response.about:
Сколько себя помню, всегда  помогала  словом и делом. 
Очень рада, что сегодня я занимаюсь тем делом, которое не только мне очень по Душе , но оно действительно помогает многим людям. И это счастье!

Задаваясь вопросами: "Как можно самой себе помочь и какие есть у меня резервы, о которых я не знаю", я нашла ответы в обучающих семинарах, тренингах, курсах, с получением сертификатов, дипломов, таких, как

- Жанны Абрамовой, МАК, Метафорические Ассоциативные карты 2016

- Константина Опекуна, Платиновый коучинг, 2015

- Людмилы Мызиной , Психологическое онлайн консультирование2015

• Колина Типпинга (основатель Института радикальной терапии и прощения в США) — тренинг Радикальное прощение. 2013г.

*Николая Лтанского - тренер международного проекта Удивительная Игра Жизни. 2013г

• Маши Беннетт (Англия) – Техника Эмоциональной Свободы (ТЭС) или Emotional Freedom Techniques   (EFT)2010г.; 

• Владислава Житорюк – «Психокинезиология. Квантовая модель      сознания», 2009г.; 

• Галины Петровны Ивановой (Москва) – авторская методика «Ошибки и иллюзии восприятия» (Родовые и ранние детские травмы) 2008; 

• Владимира Белушкина, Андрея Архипова – система Чжун Юань Цигун (три      ступени) 2008г.; 

• Андрея Сидерского, Эдуарда Жарук, Анатолия Зенченко  интенсивы – хатха-йога;
